import React, { useState, useEffect } from "react";

function SubjectTests() {
   const [tests, setTests] = useState([]);

   useEffect(() => {
    fetch("/subTests")
      .then((res) => res.json())
      .then((data) => setTests(data.data))
      .catch((err) => console.error(err));
   }, []);


  return (
    <div>
      <h2>All Subjects and Tests:</h2>
      <table>
        <thead>
          <tr>
            <th>Subject</th>
            <th>Test Name</th>
            <th>Date</th>
            <th>Time Limit</th>
          </tr>
        </thead>
        <tbody>
          {tests.map((test) => (
            <tr key={test._id}>
              <td>{test.subject}</td>
              <td>{test.name}</td>
              <td>{test.date}</td>
              <td>{test.timeLimit}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default SubjectTests
